(1, 3, 2, 'Les désastreuses aventures des orphelins Baudelaire : un teaser délicieusement épouvantable pour la saison 2', '\"Le mieux est parfois l\'ennemi du bien. Au point d\'être bien pire. Le 30 mars, attendez-vous à plus de méchants, de perfides machinations, de périls, d\'orphelins et d\'incendies volontaires. \" Tel est le programme de la saison 2 des Désastreuses aventures des orphelins Baudelaire, la série Netflix adaptée des romans de Daniel Handler. Le teaser nous offre une petite mise en bouche avec nos trois héros qui tentent d’échapper tant bien que mal aux pièges du terrible comte Olaf (Neil Patrick Harris). Et surtout, il nous dévoile la première image de Nathan Fillion (Castle) qui, selon les rumeurs, pourrait camper le père du narrateur Lemony Snicket.\r\n\r\nLa saison 2 des orphelins Baudelaire, qui risque d’être l’avant-dernière, couvrira quatre nous romans allant de \"Pièce au collège\" à \"La Fête Féroce\". Après un petit tour à l’internat – où nous découvrirons le personnage de Monsieur Nero, Violette, Klaus et Prunille nous emmèneront au cirque pour de nouveaux gags… burlesques.\r\n\r\nLes nouveaux épisodes seront à binge-watcher dès le 30 mars sur Netflix.', , '2018-02-15 14:35:27');

